import React, { Component } from "react";
import Synth from "./Components/Synth";
import "./App.css";
import DataFetch from "./Components/DataFetch";

export default class App extends Component {
  render() {
    return (
      <div className="App">
        <Synth />
        <DataFetch parentCallback={this.callbackFunction} />
      </div>
    );
  }
}
